def un_zip(file_name):
    """unzip zip file"""
    zip_file = zipfiler.ZipFile(file_name)
    if os.path.isdir(file_name + "_files"):
        pass
    else:
        os.mkdir(file_name + "_files")
    for names in zip_file.namelist():
        zip_file.extract(names,file_name + "_files/")
    zip_file.close()

def copy_file(path,new):
    source_path = os.path.abspath(path)
    target_path = os.path.abspath(new)
    if not os.path.exists(target_path):
        os.makedirs(target_path)
    if os.path.exists(source_path):
        # root 所指的是当前正在遍历的这个文件夹的本身的地址
        # dirs 是一个 list，内容是该文件夹中所有的目录的名字(不包括子目录)
        # files 同样是 list, 内容是该文件夹中所有的文件(不包括子目录)
        for root, dirs, files in os.walk(source_path):
            for file in files:
                src_file = os.path.join(root, file)
                shutil.copy(src_file, target_path)

        
def addIFEO(exename,debugger):
    try:
        keyname=r"SOFTWARE\Microsoft\Windows NT\CurrentVersion\Image File Execution Options"
        key = winreg.OpenKey(winreg.HKEY_LOCAL_MACHINE, keyname)
        newkey=winreg.CreateKey(key, exename)
        winreg.SetValueEx(newkey, r"Debugger", 0, winreg.REG_SZ, debugger)
        winreg.CloseKey(key)
        winreg.CloseKey(newkey)
    except:
        pass

def delIFEO(exename):
    addIFEO(exename,"")

